// src/components/Home.js
import React from 'react';
import { Typography, Box } from '@mui/material';
import uiucLogo from '../assets/dassl.png'; 
import backgroundImage from '../assets/bg.png'; 

function Home() {
  return (
    <Box 
      sx={{
        width: '100vw',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        background: `url(${backgroundImage}) no-repeat center center fixed`,
        backgroundSize: 'cover',
        color: 'white',
        textAlign: 'center',
      }}
    >
      <Typography variant="h2" component="h1" gutterBottom sx={{ fontWeight: 'bold', textShadow: '3px 3px 6px rgba(0, 0, 0, 0.7)', backgroundColor: 'rgba(0, 0, 0, 0.9)', padding: '30px', borderRadius: '10px' }}>
        Distributed and Storage Systems Lab
      </Typography>
      <Typography variant="h4" component="h2" gutterBottom sx={{ fontStyle: 'italic', textShadow: '2px 2px 5px rgba(0, 0, 0, 0.5)', backgroundColor: 'rgba(0, 0, 0, 0.9)', padding: '30px', borderRadius: '10px' }}>
        Driving Innovation in Distributed Systems and Storage Solutions
      </Typography>
    </Box>
  );
}

export default Home;
